Here are the steps to update the file:

1. Remove the `@Stateless` annotation from the `ShippingService` class.
2. Add the `@ApplicationScoped` annotation to the `ShippingService` class. This will make the bean application-scoped, which means it will be created once and shared across the application.
3. No changes are needed to the `@Remote` annotation, as it is not related to the issue at hand.

Note that we are not removing the `@Remote` annotation, as it is likely used for remote interface definition, which is still valid in Quarkus.

